// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

abstract contract Precompile {
  function bn256Fp12Mul (uint256[24] calldata) virtual public returns (uint256[12] memory);
}

contract TestContract {
  uint256[12] result;

  event Debug(string message, uint256[12] res);

  Precompile prec = Precompile(0x0000000000000000000000000000000000000014);

  function test (uint256[24] calldata input) public {
    result = prec.bn256Fp12Mul(input);
    emit Debug("test()", result);
  }
}
